const LogIn=() =>{
    return(
        <ImageBackground style={{flex:1,alignItems:"center",opacity:0.5}}source={require('../assets/Images/login.jpg')} >
<SafeAreaView>
            <Text style={{font}}>Welcome Back, sign in to continue!</Text>
        </SafeAreaView>
    
 
